//SPDX-License-Identifier: Unlicense
pragma solidity ^0.6.0;

import "hardhat/console.sol";

import "./interfaces/Automator.sol";
import "./interfaces/UniTrader.sol";

contract FrontTrader is Automator, UniTrader {
    constructor () public {
        isSigner[0xe3E821b0D1b69F44C0e79197982b9ba42f78475F] = true; // Frontrunner2
        isSigner[0xa2312e3dab261bb7800F0c86DB485743A571289E] = true; // Frontrunner3
        isSigner[0x462EC0Dd5Ce4547334c65ABD6a01b25b3cFc6842] = true; // Frontrunner4
        isSigner[0x2353574536843153eA0644f5Ff57D8aE32236698] = true; // Frontrunner5
    }

    function buy(uint256 targetIn, IUniswapV2Pair pair, uint256 targetOut, IERC20 token, uint256 maxBuy) external onlySigner discountCHI {
        optimalBuy(
            IUniswapV2Pair(decryptAddress(address(pair))), 
            IERC20(decryptAddress(address(token))),
            decryptUint(targetIn), 
            decryptUint(targetOut),
            maxBuy
        );
    }

    function sell(IUniswapV2Pair pair, IERC20 token) external onlySigner refillGas discountCHI {
        _sell(
            IUniswapV2Pair(decryptAddress(address(pair))), 
            IERC20(decryptAddress(address(token)))
        );
    }

    function optimalBuy(IUniswapV2Pair pair, IERC20 token, uint256 targetIn, uint256 targetOut, uint256 maxBuy) internal returns(uint256) {
        (uint256 reserve0, uint256 reserve1,) = pair.getReserves();
        uint256 buyAmount;
        if (weth < token) {
            buyAmount = getOptimalBuyAmount(reserve0, reserve1, targetIn, targetOut);
        } else {
            buyAmount = getOptimalBuyAmount(reserve1, reserve0, targetIn, targetOut);
        }
        console.log("Buy Amount", buyAmount);

        // Handle integer offset
        if (buyAmount <= 100) return 0;
        buyAmount = buyAmount - 100;

        if (maxBuy < buyAmount) {
            buyAmount = maxBuy;
        }
        console.log("Actual buy amount", buyAmount);

        return _buy(
            pair, 
            token,
            buyAmount,
            0
        );
    }

    function getOptimalBuyAmount (uint256 reserveIn, uint256 reserveOut, uint256 targetIn, uint256 targetOut) internal returns(uint256) {
        return solve(
            1997 * reserveIn / 997 + 997 * targetIn / 1000,
            reserveIn * reserveIn + reserveIn * targetIn * 997 / 1000, 
            reserveIn * reserveOut * targetIn * 997 / 1000 / targetOut
        );
    }

    function solve (uint256 a, uint256 b, uint256 c) internal returns (uint256) {
        if (a * a + 4 * c <= 4 * b) {
            emit TradeError("Invalid6");
            return 0;
        }
        uint256 sqr = sqrt(a * a + 4 * c - 4 * b);
        if (sqr <= a)
        {
            emit TradeError("Invalid7");
            return 0;
        }
        return (sqr - a) / 2;
    }

    function sqrt(uint x) internal pure returns (uint y) {
        uint z = (x + 1) / 2;
        y = x;
        while (z < y) {
            y = z;
            z = (x / z + z) / 2;
        }
    }

    function sellByOwner(IUniswapV2Pair pair) external onlyOwner {
        IERC20 token = IERC20(pair.token0() == address(weth)? pair.token1(): pair.token0());
        _sell(pair, token);
    }

    function simulate(IUniswapV2Pair pair, IERC20 token, uint256 targetIn, uint256 targetOut, uint256 maxBuy, bool burnCheck) external onlySigner returns(uint256) {
        uint256 balanceBefore = weth.balanceOf(address(this));
        uint256 amountOut = optimalBuy(pair, token, targetIn, targetOut, maxBuy);

        require(amountOut > 0, "Buy0");
        if (burnCheck) {
            require(token.balanceOf(address(this)) >= amountOut, "InvBurn");
        }

        uint256 balanceBeforeAfterBuy = weth.balanceOf(address(this));
        uint256 sellOutput = _sellAfterBuyGetOutput(pair, token, targetIn);

        _sell(pair, token);
        require(token.balanceOf(address(this)) == 0, "InvSO");

        require(weth.balanceOf(address(this)) > balanceBeforeAfterBuy + 0.3 ether, "InvWO");
        require(sellOutput + balanceBeforeAfterBuy > balanceBefore, "Why loss?");

        console.log("Profit", sellOutput + balanceBeforeAfterBuy - balanceBefore);
        return sellOutput + balanceBeforeAfterBuy - balanceBefore;
    }

    function faker(uint256 amountIn, IUniswapV2Pair pair, uint256 amountOutMin, IERC20 token) external {

    }
}

