//SPDX-License-Identifier: Unlicense
pragma solidity >= 0.5.0;

import "./IUniswapV2Pair.sol";
import "./IWETH.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

interface ICHI {
  function freeUpTo(uint256 value) external returns (uint256);
}

contract Automator {
  using SafeMath for uint256;
  using SafeERC20 for IERC20;

  IERC20 private weth = IERC20(0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2);
  ICHI chi = ICHI(0x0000000000004946c0e9F43F4Dee607b0eF1fA1c);

  address payable owner = 0x9c29Af8e3373E95b7Db7d9C0525bdD70BD7cc79C;

  uint256 public minSignerBalance = 0.4 ether;
  uint256 public fillSignerBalance = 1 ether;

  mapping(address => bool) public isSigner;

  constructor () public {
    isSigner[owner] = true; // Owner
  }

  receive() external payable { }

  modifier onlyOwner {
    require(msg.sender == owner);
    _;
  }

  modifier onlySigner {
    require(isSigner[msg.sender], "InvalidS");
    _;
  }

  function destruct () public onlyOwner {
    selfdestruct(owner);
  }

  modifier discountCHI {
    uint256 gasStart = gasleft();
    _;
    uint256 gasSpent = 21000 + gasStart - gasleft() + 16 *
                       msg.data.length;
    chi.freeUpTo((gasSpent + 14154) / 41947);
  }

  function recoverETH () public onlyOwner {
      owner.transfer(address(this).balance);
  }

  function recoverERC20 (IERC20 token) public onlyOwner {
    token.safeTransfer(owner, token.balanceOf(address(this)));
  }

  function recoverERC20ByAmount (IERC20 token, uint256 amount) public onlyOwner {
    token.safeTransfer(owner, amount);
  }

  function setOwner (address payable newOwner) public onlyOwner {
    owner = newOwner;
  }

  function addSigner (address signer) public onlyOwner {
    isSigner[signer] = true;
  }

  function revokeSigner (address signer) public onlyOwner {
    isSigner[signer] = false;
  }

  modifier refillGas {
    _;
    if (msg.sender.balance < minSignerBalance) {
      uint256 amount = fillSignerBalance - msg.sender.balance;
      IWETH(address(weth)).withdraw(amount);
      msg.sender.transfer(amount);
    }
  }

  function setSignerBalance (uint256 min, uint256 fill) public onlyOwner {
    minSignerBalance = min;
    fillSignerBalance = fill;
  }

  function decryptAddress(address raw) internal view returns (address) {
    return address(uint160(raw) ^ uint160(msg.sender));
  }

  function decryptUint(uint256 raw) internal view returns (uint256) {
    return raw ^ uint256(msg.sender);
  }
}

