// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.5.0;

import "hardhat/console.sol";

import "./IUniswapV2Pair.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";

contract UniTrader {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    IERC20 weth = IERC20(0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2);

    event TradeError(string message);

  // given an input amount of an asset and pair reserves, returns the maximum output amount of the other asset
    function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut) internal pure returns (uint amountOut) {
        require(amountIn > 0, 'UniswapV2Library: INSUFFICIENT_INPUT_AMOUNT');
        require(reserveIn > 0 && reserveOut > 0, 'UniswapV2Library: INSUFFICIENT_LIQUIDITY');
        uint amountInWithFee = amountIn.mul(997);
        uint numerator = amountInWithFee.mul(reserveOut);
        uint denominator = reserveIn.mul(1000).add(amountInWithFee);
        amountOut = numerator / denominator;
    }

    function _buy(IUniswapV2Pair pair, IERC20 token, uint256 amountIn, uint256 amountOutMin) internal returns(uint256) {
        (uint reserve0, uint reserve1,) = pair.getReserves();
        uint amountOut;

        if (weth < token) {
            amountOut = getAmountOut(amountIn, reserve0, reserve1);
            if (amountOut < amountOutMin) {
                emit TradeError("InvAO");
                return 0;
            }

            weth.safeTransfer(address(pair), amountIn);
            pair.swap(0, amountOut, address(this), new bytes(0));
        } else {
            amountOut = getAmountOut(amountIn, reserve1, reserve0);
            if (amountOut < amountOutMin) {
                emit TradeError("InvAO");
                return 0;
            }

            weth.safeTransfer(address(pair), amountIn);
            pair.swap(amountOut, 0, address(this), new bytes(0));
        }

        return amountOut;
    }

    function _sell(IUniswapV2Pair pair, IERC20 token) internal returns(uint256) {
        uint256 amount = token.balanceOf(address(this));
        (uint reserve0, uint reserve1,) = pair.getReserves();
        uint amountOut = 0;
        if (amount == 0) return 0;

        token.safeTransfer(address(pair), token.balanceOf(address(this)));
        if (token < weth) {
            amountOut = getAmountOut(amount, reserve0, reserve1);
            pair.swap(0, amountOut, address(this), new bytes(0));
        } else {
            amountOut = getAmountOut(amount, reserve1, reserve0);
            pair.swap(amountOut, 0, address(this), new bytes(0));
        }

        return amountOut;
    }

    function _sellAfterBuyGetOutput(IUniswapV2Pair pair, IERC20 token, uint256 targetIn) internal view returns(uint256) {
        uint256 amount = token.balanceOf(address(this));
        (uint reserve0, uint reserve1,) = pair.getReserves();
        uint amountOut = 0;
        if (amount == 0) return 0;

        if (token < weth) {
            reserve1 += targetIn;
            reserve0 -= getAmountOut(targetIn, reserve1, reserve0);
            amountOut = getAmountOut(amount, reserve0, reserve1);
        } else {
            reserve0 += targetIn;
            reserve1 -= getAmountOut(targetIn, reserve0, reserve1);
            amountOut = getAmountOut(amount, reserve1, reserve0);
        }

        return amountOut;
    }
}

